delete from n_device_manufacturer where 1 = 1;

delete from  n_device_series_info where  1=1;

delete from  n_device_series_tree where  1=1;

SELECT UUID(),NULL,code,'1','system',NULL,UTC_TIMESTAMP(),NULL,1,NULL,NULL  FROM n_device_manufacturer ;

SELECT UUID(),pid,relation,'2','system',NULL,UTC_TIMESTAMP(),NULL,1,NULL,NULL FROM
    (
        SELECT
            n_device_series_tree.id AS pid,
            n_device_series_info.device_type AS relation
        FROM
            n_device_series_info
                LEFT JOIN n_device_series_tree ON n_device_series_info.manufacturer_code = n_device_series_tree.relation
        WHERE
            n_device_series_tree.relation IS NOT NULL
        GROUP BY
            n_device_series_tree.id,
            n_device_series_info.device_type
    ) t;



